function validate(values) {
  var errors = {};

  if (!values.firstName) {
    errors.firstName = "First Name Required";
  }

  if (!values.lastName) {
    errors.lastName = "Last Name Required";
  }

  if (!values.title) {
    errors.title = "Title Required";
  }

  if (!values.gender) {
    errors.gender = "Gender Required";
  }

  if (!values.birth) {
    errors.birth = "Birth Required";
  }

  if (!values.office) {
    errors.office = "Office Phone Number Required";
  } else if (values.office.length < 12) {
    errors.office = "Incomplete Office Phone Number";
  }

  if (!values.mobile) {
    errors.mobile = "Mobile Phone Number Required";
  } else if (values.mobile.length < 12) {
    errors.mobile = "Incomplete Mobile Phone Number";
  }

  if (!values.location) {
    errors.location = "Location Required";
  }

  if (!values.email) {
    errors.email = "Email Required";
  } else if (!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i.test(values.email)) {
    errors.email = 'Invalid Email Address';
  }

  if (!values.hire) {
    errors.hire = "Hire Date Required";
  }

  return errors;
}

